import React from 'react';
import '../assets/styles/PhotoGallery.scss';
import pg01 from '../assets/images/pg01.png';
import pg02 from '../assets/images/pg02.png';
import pg03 from '../assets/images/pg03.png';

const photos = [
    pg01,
    pg02,
    pg03,
    // Add more photos here
];

const PhotoGallery = () => {
    return (
        <div id="gallery" className="photo-gallery">
            <h2>Photo Gallery</h2>
            <div className="gallery-grid">
                {photos.map((photo, index) => (
                    <div key={index} className="gallery-item">
                        <img src={photo} alt={`Gallery item ${index + 1}`} />
                    </div>
                ))}
            </div>
        </div>
    );
};

export default PhotoGallery;
